import React, { Component } from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText
  } from 'reactstrap';
class NavbarComp extends Component {
    render() { 
        return (  
            <div>
            <nav className="App" >
               <div className="container">
                    <img src="./images1/HighRadius...jpg"></img>
               </div>
           </nav>
          </div>
        );
    }
}
 
export default NavbarComp;
